import React from "react";
import ReactDOM from "react-dom/client";
import "./index.css";

const root = ReactDOM.createRoot(document.getElementById("root"));
const user = {
  name: "Bob Marley",
  imageSize: "90px",
  imgUrl: "https://i.imgur.com/yXOvdOSs.jpg",
};

function MyButton() {
  return <button>Click me</button>;
}
function FormInput({ inputType, labelTitle, inputName }) {
  return (
    <>
      <label for={inputName}>{labelTitle}</label>
      <input type={inputType} name={inputName} required />
    </>
  );
}
function LoginForm() {
  return (
    <div className="form-container">
      <div className="form-header">
        <img className="form-icon" />
        <div className="form-title">Sign in to your account</div>
      </div>
      <div className="form">
        <FormInput />
        <label for="psw">Password</label>
        <input type="text" name="pwd" required />
      </div>
      <button type="button">Sign in</button>
    </div>
  );
}

export default function App() {
  return (
    <>
      <div>
        <h1>{user.name}</h1>
        <img
          className="avatar"
          src={user.imgUrl}
          style={{
            width: user.imageSize,
            height: user.imageSize,
            borderRadius: "50%",
          }}
        />
        <MyButton />
      </div>
    </>
  );
}

root.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>,
);
